import CoreGraphics
import Foundation

public extension QRCode.EyeShape {
	@objc(QRCodeEyeShapeFabricScissors) class FabricScissors: NSObject, QRCodeEyeShapeGenerator {
		@objc public static let Name = "fabricScissors"
		@objc public static var Title: String { "Fabric Scissors" }
		@objc public static func Create(_ settings: [String: Any]?) -> any QRCodeEyeShapeGenerator { FabricScissors() }
		@objc public func settings() -> [String: Any] { return [:] }
		@objc public func supportsSettingValue(forKey key: String) -> Bool { false }
		@objc public func setSettingValue(_ value: Any?, forKey key: String) -> Bool { false }
		@objc public func copyShape() -> any QRCodeEyeShapeGenerator { FabricScissors() }

		/// Reset the eye shape generator back to defaults
		@objc public func reset() { }

		public func eyePath() -> CGPath { eyeFrameOuter__ }
		public func eyeBackgroundPath() -> CGPath { eyeFrameBackground__ }

		private static let _defaultPupil = QRCode.PupilShape.FabricScissors()
		public func defaultPupil() -> any QRCodePupilShapeGenerator { Self._defaultPupil }
	}
}

public extension QRCodeEyeShapeGenerator where Self == QRCode.EyeShape.FabricScissors {
	/// Create a dot drag eye shape generator
	/// - Returns: An eye shape generator
	@inlinable static func fabricScissors() -> QRCodeEyeShapeGenerator { QRCode.EyeShape.FabricScissors() }
}

